import React, { Component } from "react";
import "../stylesheets/App.css";
import { UsernameForm } from "./UsernameForm";

class App extends Component {
  render() {
    return (
      <div>
        <UsernameForm
          name=""
          action="gettopartists"
          period="overall"
          limit="10"
        />
      </div>
    );
  }
}

export default App;
